import React, { Component } from 'react';
import { Alert } from 'reactstrap';
var classNames = require('classnames');


class Test extends Component {
  render() {

    document.addEventListener('DOMContentLoaded', function(){
      const gauche = document.querySelector(".gauche");
      const droite = document.querySelector(".droite");

    });

      gauche.addEventListener("mouseenter", () => {
        console.log('ok gauche');
      });

      droite.addEventListener("mouseenter", () => {
        console.log('ok droite')
      });

    return (
      <div className="block">

      <Alert color="primary" className="gauche">
        This is a primary alert — check it out!
      </Alert>
      <Alert color="secondary" className="droite">
        This is a primary alert — check it out!
      </Alert>

      </div>
    )
  }
}


export default Test
